import React from "react";
import styled from "styled-components";

const StyleCard = styled.div`
    position: relative;
    width: 400px;
`;
const CartImage = styled.div`
    height: 400px;
    width: 100%;
    border-radius: 8px;
`;
const CardImg = styled.img`
    width: 100%;
    height: 100%;
    display: block;
    border-radius: inherit;
    object-fit: cover;
`;
const CardContent = styled.div`
    position: absolute;
    background-color: #fff;
    width: 100%;
    padding: 20px;
    left: 50%;
    transform: translate(-50%, 50%);
    border-radius: 20px;
    bottom: 0;
`;
const CardTop = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 30px;
`;
const CartUser = styled.div`
    display: flex;
    align-items: center;
    column-gap: 20px;
`;
const CardUserImg = styled.img`
    height: 30px;
    width: 30px;
    border-radius: 100rem;
    object-fit: cover;
    flex-shrink: 0;
`;
const CardFooter = styled.div`
    width: 230px;
    height: 27px;
    font-weight: 500;
    font-size: 18px;
    line-height: 27px;
`;
const Card = () => {
    return (
        <StyleCard>
            <CartImage>
                <CardImg
                    src="https://cdn.dribbble.com/users/2400293/screenshots/16630840/media/ed6af0d38d460ff9ee426ad69e6435ea.png?compress=1&resize=1000x750&vertical=top"
                    alt=""
                />
            </CartImage>
            <CardContent>
                <CardTop>
                    <CartUser>
                        <CardUserImg
                            src="https://cdn.dribbble.com/users/2400293/screenshots/16630840/media/ed6af0d38d460ff9ee426ad69e6435ea.png?compress=1&resize=1000x750&vertical=top"
                            alt=""
                        />
                        <span>@zndrson</span>
                    </CartUser>
                    <div>256</div>
                </CardTop>
                <div>
                    <h3>Cosmic Perspective</h3>
                    <span>12,000 PSL</span>
                </div>
            </CardContent>
        </StyleCard>
    );
};

export default Card;
